webpackJsonp([39,423],{2:function(e,t){e.exports="data:image/png;base64,"},22:function(e,t){e.exports="data:image/png;base64,"},24:function(e,t){e.exports="data:image/png;base64,"},245:function(e,t,l){e.exports=l.p+"_/oppgaver/src/scratch/hvor_i_all_verden/hvor_i_all_verden_1.2a25cc.png"},246:function(e,t,l){e.exports=l.p+"_/oppgaver/src/scratch/hvor_i_all_verden/reisemaal.52aec0.png"},1566:function(e,t,l){e.exports={frontmatter:l(583),content:l(2740)}},2740:function(e,t,l){e.exports="<section class=intro id=introduksjon> <h1 class=intro id=introduksjon>Introduksjon</h1> <p>Hvor i All Verden? er et reise- og geografispill hvor man raskest mulig skal fly innom reisemål spredt rundt i Europa. I denne første leksjonen vil vi se på hvordan vi styrer figurer rundt omkring på skjermen, og hvordan vi får forskjellige figurer til å reagere på hverandre.</p> <p>I senere leksjoner vil vi utvide kartet vi flyr over ved å lage en bakgrunn som flytter seg. Vi vil også se på hvordan vi kan lage lister som holder oversikt over alle stedene vi kan besøke.</p> <figure><img src="+l(245)+' alt=""></figure> </section> <section class=activity id=steg-1-styr-et-helikopter> <h1 class=activity id=steg-1-styr-et-helikopter>Steg 1: Styr et helikopter</h1> <p><em>Vi begynner med å lage et lite program som gjør at vi kan styre et helikopter med piltastene.</em></p> <section class=check id=sjekkliste> <h2 class=check id=sjekkliste>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_0><label for=cbx_0> Start et nytt Scratch-prosjekt. Slett kattefiguren, for eksempel ved å høyreklikke på den og velge <code>slett</code>.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_1><label for=cbx_1> Legg til en ny figur ved å klikke <img src='+l(2)+' alt="Velg figur fra biblioteket"> under <code>Figurer</code>. Vi har brukt <code>Transport/Helicopter</code>, men du kan gjerne bruke en annen figur å reise rundt med.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_2><label for=cbx_2> Klikk <code class=blockmotion>i</code> og skift navn på figuren til <code>Helikopter</code>.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_3><label for=cbx_3> Klikk på scenen til venstre for figurene, og lag det følgende skriptet:</label></p> <pre class=blocks>når grønt flagg klikkes\nsend melding [Nytt spill v]\n</pre> <p>Vi skal diskutere hvorfor vi gjør dette i mer detalj senere. Kort sagt gir det oss mer fleksibilitet i forhold til hvordan vi starter og avslutter spillet.</p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_4><label for=cbx_4> Klikk på helikopteret igjen. Klikk deretter <code class=blockdata>Data</code> og lag en variabel som heter <code class=blockdata>hastighet</code> og som gjelder for denne figuren.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_5><label for=cbx_5> Deretter bygger vi noen klosser hvor vi bestemmer egenskaper ved helikopteret som ikke forandrer seg i løpet av spillet, for eksempel størrelsen og hastigheten.</label></p> <pre class=blocks>når grønt flagg klikkes\nskjul\nbegrens rotasjon [vend sideveis v]\nsett størrelse til (30) %\nsett [hastighet v] til [5]\n</pre> <p>Eksperimenter gjerne med andre verdier for disse klossene, slik at du finner de verdiene du mener er best for ditt spill!</p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_6><label for=cbx_6> Nå skal vi lage en av de viktigste delene av spillet, nemlig hvordan helikopteret flytter seg rundt. Dette legger vi inn i en løkke som alltid kjører.</label></p> <pre class=blocks>når jeg mottar [Nytt spill v]\ngå til x: (0) y: (0)\nvis\nfor alltid\n    hvis &lt;tast [pil høyre v] trykket?&gt;\n        pek i retning (90 v)\n        gå (hastighet) steg\n    slutt\n    hvis &lt;tast [pil venstre v] trykket?&gt;\n        pek i retning (-90 v)\n        gå (hastighet) steg\n    slutt\nslutt\n</pre> </li> </ul> </section> <section class=flag id=test-prosjektet> <h2 class=flag id=test-prosjektet>Test prosjektet</h2> <p><strong>Klikk på det grønne flagget.</strong></p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_7><label for=cbx_7> Kan du bruke piltastene til å styre helikopteret rundt omkring? Vi har bare bestemt hva som skal skje når <code>pil høyre</code> og <code>pil venstre</code> trykkes. Prøv selv å legge inn kode for hva som skal skje når <code>pil opp</code> og <code>pil ned</code> trykkes.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_8><label for=cbx_8> Hva gjør klossen <code class=blockmotion>begrens rotasjon vend sideveis</code>? Prøv å endre verdiene i nedtrekksmenyen for å se hva som skjer.</label></p> </li> </ul> </section> </section> <section class=activity id=steg-2-et-enkelt-kart> <h1 class=activity id=steg-2-et-enkelt-kart>Steg 2: Et enkelt kart</h1> <p><em>Vi legger nå inn et kart som en bakgrunn. Dette vil vi i denne leksjonen bruke til å fly over. I senere leksjoner vil vi også lære hvordan vi kan få dette bakgrunnskartet til å bevege seg.</em></p> <section class=check id=sjekkliste-2> <h2 class=check id=sjekkliste-2>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_9><label for=cbx_9> Vi vil først laste ned kartet fra nettet. Åpne lenken <a href=europakart.png>europakart.png</a> i en ny fane i nettleseren din. Dette vil åpne et bilde av et europakart. Høyreklikk på bildet, og velg <code>Lagre bildet som</code> eller noe som ligner. Lagre bildet et sted du finner det igjen.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_10><label for=cbx_10> Velg <img src='+l(24)+' alt="Last opp bakgrunn fra fil"> under <code>Ny bakgrunn</code> helt til venstre på skjermen. Velg filen <code>europakart.png</code> du nettopp lastet ned.</label></p> </li> </ul> </section> <section class=flag id=test-prosjektet-2> <h2 class=flag id=test-prosjektet-2>Test prosjektet</h2> <p><strong>Klikk på det grønne flagget.</strong></p> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_11><label for=cbx_11> Ser det ut som om helikopteret flyr rundt i Europa? Prøv gjerne å eksperimentere mer med egenskapene til helikopteret: størrelse, hastighet og så videre.</label></li> </ul> </section> </section> <section class=activity id=steg-3-legg-til-et-reisemal> <h1 class=activity id=steg-3-legg-til-et-reisemal>Steg 3: Legg til et reisemål</h1> <p><em>Vi skal nå gi helikopteret et mål det kan fly til.</em></p> <section class=check id=sjekkliste-3> <h2 class=check id=sjekkliste-3>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_12><label for=cbx_12> Vi begynner med å tegne en liten figur som kan markere reisemålet i kartet. Velg <img src='+l(22)+' alt="Tegn ny figur"> under <code>Figurer</code>.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_13><label for=cbx_13> Velg en passende farge. For eksempel vil rød synes ganske godt på kartet. Velg deretter sirkeverktøyet, og marker den fyllte sirkelen (ellipsen) til venstre under tegnevinduet.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_14><label for=cbx_14> Før du begynner å tegne kan du forstørre tegningen din ved å trykke på forstørrelsesglasset nederst til høyre. For eksempel vil 800% forstørrelse passe bra. Hold inne <code>skift</code>-knappen mens du drar ut en sirkel som er omtrent fire ruter stor. <code>skift</code>-knappen hjelper deg til å lage en helt rund sirkel.</label></p> <figure><img src='+l(3481)+' alt=""></figure> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_15><label for=cbx_15> Gi denne nye figuren navnet <code>Sted</code>.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_16><label for=cbx_16> Dra denne nye sted-figuren til et sted på kartet du vil at skal være reisemålet. Vi har brukt <code>Barcelona</code> her, men du kan velge et annet sted om du vil.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_17><label for=cbx_17> Vi trenger nå posisjonen til sted-figuren vår. Denne finner vi enklest ved å se på figurinformasjonen etter tallene som står bak <code>x</code> og <code>y</code>. Disse tallene kalles koordinater. I eksempelet under er koordinatene <code>x: -98</code> og <code>y: -120</code>. Koordinatene forteller hvor på kartet vi har lagt reisemålet vårt.</label></p> <figure><img src='+l(246)+' alt=""></figure> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_18><label for=cbx_18> Vi lager nå litt kode som passer på at reisemålet ligger riktig plassert på kartet, og som sier i fra hvis vi finner veien til Barcelona.</label></p> <pre class=blocks>når jeg mottar [Nytt spill v]\nsend melding [Nytt sted v]\n\nnår jeg mottar [Nytt sted v]\ngå til x: (-98) y: (-120)\nvent til &lt;berører [Helikopter v]?&gt;\nsi [Fant Barcelona!] i (2) sekunder\n</pre> </li> </ul> </section> <section class=flag id=test-prosjektet-3> <h2 class=flag id=test-prosjektet-3>Test prosjektet</h2> <p><strong>Klikk på det grønne flagget.</strong></p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_19><label for=cbx_19> Ligger den røde sirkelen der den skal være?</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_20><label for=cbx_20> Hva skjer om du styrer helikopteret til den røde sirkelen?</label></p> </li> </ul> </section> </section> <section class=activity id=steg-4-skjul-reisemalet> <h1 class=activity id=steg-4-skjul-reisemalet>Steg 4: Skjul reisemålet</h1> <p><em>Dette er så langt et veldig enkelt spill, siden spilleren bare trenger å fly til den røde sirkelen. For å gjøre det litt vanskeligere vil vi nå skjule sirkelen, og heller bare fortelle spilleren hvilken by hun skal fly til!</em></p> <section class=check id=sjekkliste-4> <h2 class=check id=sjekkliste-4>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_21><label for=cbx_21> En måte å gi beskjed til spilleren på, er ved å bruke variabler. Lag en ny variabel som du kaller <code class=blockdata>Reis til</code>. La denne variabelen gjelde <em>for alle figurer</em>.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_22><label for=cbx_22> Legg merke til at det dukket opp en boks på kartet, <code class=blocklightgrey>Reis til</code><code class=blockdata>0</code>. Flytt denne boksen til et passende sted slik at den er lett å lese.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_23><label for=cbx_23> Oppdater skriptet til <strong>Sted</strong> slik at <code class=blockdata>Reis til</code>-variabelen blir satt til <code>Barcelona</code> rett etter <code class=blockmotion>gå til</code>-klossen.</label></p> </li> </ul> <p>Vi vil nå skjule den røde sirkelen. La oss først prøve det enkleste og mest opplagte:</p> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_24><label for=cbx_24> Legg til en <code class=blocklooks>skjul</code>-kloss etter <code class=blockevents>når jeg mottar Nytt spill</code>.</label></li> </ul> </section> <section class=flag id=test-prosjektet-4> <h2 class=flag id=test-prosjektet-4>Test prosjektet</h2> <p><strong>Klikk på det grønne flagget.</strong></p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_25><label for=cbx_25> Blir den røde sirkelen borte?</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_26><label for=cbx_26> Hva skjer om du reiser til Barcelona?</label></p> </li> </ul> <p>Hmm ... spillet oppdager ikke lengre at vi reiser til Barcelona. Problemet er at siden vi skjuler sirkelen vil den ikke lengre berøre <strong>Helikopter</strong>. Vi må finne en annen måte å gjøre sirkelen usynlig på!</p> </section> <section class=check id=sjekkliste-5> <h2 class=check id=sjekkliste-5>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_27><label for=cbx_27> I stedet for å skjule sirkelen helt vil vi heller gjøre den gjennomsiktig. Bytt ut <code class=blocklooks>skjul</code>-klossen med en <code class=blocklooks>sett effekt</code>-kloss:</label></p> <pre class=blocks>når jeg mottar [Nytt spill v]\nvis\nsett [gjennomsiktig v] effekt til (100)\nsend melding [Nytt sted v]\n</pre> </li> </ul> </section> <section class=flag id=test-prosjektet-5> <h2 class=flag id=test-prosjektet-5>Test prosjektet</h2> <p><strong>Klikk på det grønne flagget.</strong></p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_28><label for=cbx_28> Er den røde sirkelen fortsatt borte?</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_29><label for=cbx_29> Hva skjer nå om du flyr til Barcelona?</label></p> </li> </ul> </section> </section> <section class=activity id=steg-5-vis-reisemalet-igjen> <h1 class=activity id=steg-5-vis-reisemalet-igjen>Steg 5: Vis reisemålet igjen</h1> <p><em>Det vil være kult å faktisk vise hvor reisemålet er etter at det er funnet.</em></p> <section class=check id=sjekkliste-6> <h2 class=check id=sjekkliste-6>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_30><label for=cbx_30> La oss lage en liten animasjon når spilleren flyr til Barcelona. Først må vi vise den røde sirkelen igjen. Det gjør vi ved å sette gjennomsiktig effekt til 0 etter at sirkelen berører <strong>Helikopter</strong>.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_31><label for=cbx_31> Animasjonen kan vi for eksempel lage med den følgende koden:</label></p> <pre class=blocks>gjenta (5) ganger\n    gjenta (10) ganger\n        endre størrelse med (10)\n    slutt\n    gjenta (10) ganger\n        endre størrelse med (-10)\n    slutt\nslutt\n</pre> <p>Hvor må du legge denne koden for at du skal se animasjonen?</p> </li> </ul> </section> <section class=flag id=test-prosjektet-6> <h2 class=flag id=test-prosjektet-6>Test prosjektet</h2> <p><strong>Klikk på det grønne flagget.</strong></p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_32><label for=cbx_32> Vises den røde sirkelen etter at du har flydd til Barcelona?</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_33><label for=cbx_33> Animeres sirkelen etter at den er funnet?</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_34><label for=cbx_34> Hva skjer med snakkeboblen <code>Fant Barcelona!</code>?</label></p> </li> </ul> </section> <section class=check id=sjekkliste-7> <h2 class=check id=sjekkliste-7>Sjekkliste</h2> <p>Det vil kanskje se bedre ut om sirkelen sier <code>Fant Barcelona!</code> samtidig som vi animerer? For å få til dette må vi bruke <code class=blocklooks>si</code>-klossen i stedet for <code class=blocklooks>si i 2 sekunder</code>, fordi den sistnevnte lar hele skriptet vente i 2 sekunder.</p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_35><label for=cbx_35> Legg til klossen</label></p> <pre class=blocks>si [Fant Barcelona!]\n</pre> <p>rett før den ytre <code class=blockcontrol>gjenta</code>-løkken.</p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_36><label for=cbx_36> For at sirkelen skal slutte å si <code>Fant Barcelona!</code> etter at animasjonen er slutt må du legge klossen</label></p> <pre class=blocks>si - [ ]\n</pre> <p>til slutt i skriptet ditt.</p> </li> </ul> </section> </section> <section class=activity id=neste-gang> <h1 class=activity id=neste-gang>Neste gang</h1> <p>Vi har nå kommet i gang med en enkel utgave av spillet vårt. Neste gang skal vi se på hvordan vi kan lage et større kart ved å få bakgrunnen til å flytte på seg. Vi skal også gjøre spillet vanskeligere ved å legge til flere reisemål.</p> <section class=try id=prov-selv> <h2 class=try id=prov-selv>Prøv selv</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_37><label for=cbx_37> Tenk over hvordan du kan legge til flere reisemål! Prøv å lage kode som gjør dette!</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_38><label for=cbx_38> For å gjøre spillet litt mer spennende kan vi følge med på hvor lang tid spilleren bruker på å fly til reisemålet. Se om du klarer å lage et skript som gjør dette! Et hint er at du kan lage en ny variabel, f.eks. <code class=blockdata>Tid</code>, og et skript som går i løkke og endrer <code class=blockdata>Tid</code> med 1 for deretter å vente 1 sekund.</label></p> </li> </ul> </section> </section> '},3481:function(e,t){e.exports="data:image/png;base64,"}});